            <Text data-layer="d753d956-8ce5-4993-8e98-1117449d914d" style={styles.attivita_raggruppa38_loremIpsumDolorSitAmetConsecteturAdipiscingElitPhasellusPlaceratPorttitorNullaNonVenenatisNamSagittisElitNislVitaeVenenatisFelisFacilisisVitaePhasellusEuFeugiatNuncCurabiturAliquetEuismodQuamBlanditVolutpatEtiamEget}>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus placerat porttitor nulla non venenatis. Nam sagittis elit nisl, vitae venenatis felis facilisis vitae. Phasellus eu feugiat nunc. Curabitur aliquet euismod quam blandit volutpat. Etiam eget orci sit amet tellus sagittis porttitor. Vestibulum dignissim lobortis libero, ac laoreet ipsum ullamcorper sed. Ut iaculis nulla vitae sem venenatis, ac lacinia sem aliquam. Phasellus et mauris varius, consectetur libero eget, euismod quam.

Mauris vitae efficitur felis, quis ultricies augue. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Morbi rutrum cursus odio sit amet vulputate. Phasellus nisl metus, placerat at leo sed, placerat ullamcorper tellus. Suspendisse id lacus auctor, semper magna nec, volutpat magna. Donec pretium, lacus et sagittis molestie, diam libero egestas dui, eu rhoncus velit odio quis ex. Cras eget orci semper sem fermentum aliquam. Nam libero ligula, sagittis id lorem non, auctor elementum nisl. Aenean pellentesque.</Text>
